// priceGridColumns.js

export const getColumns = (currencyIconMap) => [
    {
        field: "haveCurrency",
        headerName: "Have Currency",
        width: 200,
        renderCell: (params) => {
          const currencyName = params.value;
          const amount = params.row.haveAmount;
          const iconUrl = currencyIconMap[currencyName];
          return (
            <div style={{ display: "flex", alignItems: "center" }}>
              <span style={{ marginRight: 8 }}>{amount}</span>
              {iconUrl && (
                <img
                  src={iconUrl}
                  alt={currencyName}
                  style={{ width: 24, height: 24, marginRight: 8 }}
                />
              )}
              <span>{currencyName}</span>
            </div>
          );
        }
      },
    // {
    //     field: "haveAmount",
    //     headerName: "Have Amt",
    //     type: "number",
    //     width: 100
    // },
    {
        field: "wantCurrency",
        headerName: "Want Currency",
        width: 200,
        renderCell: (params) => {
            const currencyName = params.value;
            const amount = params.row.wantAmount;
            const iconUrl = currencyIconMap[currencyName];
            return (
                <div style={{ display: "flex", alignItems: "center" }}>
                  <span style={{ marginRight: 8 }}>{amount}</span>
                  {iconUrl && (
                    <img
                      src={iconUrl}
                      alt={currencyName}
                      style={{ width: 24, height: 24, marginRight: 8 }}
                    />
                  )}
                  <span>{currencyName}</span>
                </div>
              );
        }
    },
    // {
    //     field: "wantAmount",
    //     headerName: "Want Amt",
    //     type: "number",
    //     width: 100
    // },
    {
        field: "lastUpdated",
        headerName: "Last Updated",
        width: 180,
        renderCell: (params) => {
            const date = new Date(params.value);
            return date.toLocaleDateString('en-US', {
              year: '2-digit',
              month: '2-digit',
              day: '2-digit',
              hour: '2-digit',
              minute: '2-digit',
              second: '2-digit'
            });
          }
    },
    {
        field: "rowType",
        headerName: "Type",
        width: 100
    },
    {
        field: "ninjaPrice",
        headerName: "Ninja Price",
        type: "number",
        width: 100
    },
    {
        field: "stock",
        headerName: "Stock",
        type: "number",
        width: 100
    }
];
